import { FC } from "react";
import GameContext from "../../store/context/game";

import './cell.scss';

type CellProps = {
  content: string;
  column: number;
  row: number;
};

const Cell: FC<CellProps> = ({ content, row, column }) => {
  const { data: { onCellClick, field } } = GameContext.useContext();
  return (
    <div className='cell__container' onClick={() => onCellClick(row, column, field)}>
      {content}
    </div>
  )
};

export default Cell;
